import styled from 'styled-components'

export const ContainerMoviePrincipal = styled.div`
display: inline-flex;

width: 9999px;

`

export const ContainerMovie = styled.div`
display: inline-flex;
flex-direction: row;
overflow-x: hidden;
border: 1px solid greenyellow;


img {
    width: 150px;
}

`
